const Search = (props) => {
    const {search, setSearch} = props;
    return (
        <input className="pl-2 h-6 bg-inherit border border-gray-500/30" placeholder="Search" type="text" name="search" id="search" value={search} onChange={e => setSearch(e.target.value)}/>
    )
}

export default Search
